$('.cse-search').change(function(){
  $('.adjust-right li.active').focus();
});
$('.cse-search').on('click', function(){
  if($(this).hasClass('active')){
    $(this).removeClass('active');
    $('.google-cse').slideUp();

    $(this).addClass('active');
    $('.google-cse').hide().removeClass('hide').slideDown();
  }
});
});
